import React from "react";

const Box = (props) => {
  return (
    <div className="maincontent">
      <h1>Name:{props.name}</h1>
      <h2>Title:{props.title}</h2>
      <p>Age:{props.age}</p>
      <ul>Age:{props.lang}</ul>
    </div>
  );
};

export default Box;
